import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';
import { Navbar } from 'react-bootstrap';
//Nav, NavItem, Jumbotron, Grid, Row, Col, Image, Button

function Header() {
    return (
        <Navbar default collapseOnSelect>
            <li>Home</li>
            <li>Search</li>
            <li>Library</li>
            <li>Contact</li>
            <li>User</li>
            <li>Log Out</li>
        </Navbar>

    );
}

export default Header;
